import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { DvCalculator, NameSplitter } from './screens';

const styles = {
  buttonGroup: {
    display: "flex",
    width: "100%",
    justifyContent: "center",
    alignItems: "center",
    marginTop: "1rem",
  },
  button: {
    backgroundColor: "white",
    color: "#89C6D3",
    fontSize: "0.8rem",
    border: "1px solid #89C6D3",
    minWidth: "10rem",
    padding: "1rem 1.5rem",
  },
  selectedButton: {
    backgroundColor: "#89C6D3",
    color: "white",
  },
}

const selected = true

ReactDOM.render(
  <React.StrictMode>
      <div className="header" />
      <div style={styles.buttonGroup}>
        <button style={selected ? styles.selectedButton : styles.button }>Calculadora de DV</button>
        <button style={styles.button}>Split de nombres</button>
      </div>
    <DvCalculator />
  </React.StrictMode>,
  document.getElementById('root')
);
